    "# Define the number of future periods to forecast\n",
    "n_periods = 12  # Adjust this number as needed\n",
    "\n",
    "# Get a forecast for the specified number of periods into the future\n",
    "forecast = model_fit.get_forecast(steps=n_periods)\n",
    "\n",
    "# Extract the forecasted values and confidence intervals\n",
    "Arima_forecast = forecast.predicted_mean\n",
    "forecast_conf_int = forecast.conf_int()\n",
    "\n",
    "# Extend the date index for the future forecast\n",
    "future_dates = pd.date_range(start=df.index[-1], periods=n_periods + 1, freq='M')[1:]\n",
    "\n",
    "# Plot historical data, future forecasts, and confidence intervals\n",
    "plt.figure(figsize=(12, 6))\n",
    "plt.plot(df.index, df['total_value_by_month'], label='Historical Data')\n",
    "plt.plot(future_dates, Arima_forecast, label='Future Forecast', color='red')\n",
    "plt.fill_between(forecast_conf_int.index, forecast_conf_int.iloc[:, 0], forecast_conf_int.iloc[:, 1], color='pink', alpha=0.3, label='95% Confidence Interval')\n",
