    "import statsmodels.api as sm\n",
    "model=sm.tsa.statespace.SARIMAX(df['total_value_by_month'],order=(1, 1, 0),seasonal_order=(0,1,1,12))\n",
    "SARIMA_results=model.fit()\n",
    "\n",
    "# Forecasting (predicting future values)\n",
    "start_index = len(train_data)\n",
    "end_index = len(train_data) + len(test_data) - 1\n",
    "Prediction_Sarima = SARIMA_results.predict(start=start_index, end=end_index, dynamic=False)\n",
    "\n",
    "# Visualize the Predicted forecasted values and compare with the actual test set\n",
    "plt.figure(figsize=(12, 6))\n",
    "plt.plot(train_data['total_value_by_month'], label='Training Data')\n",
    "plt.plot(test_data['total_value_by_month'], label='Test Data')\n",
    "plt.plot(test_data.index, Prediction_Sarima, label='Prediction', color='red')\n",
    "plt.xlabel('Date')\n",
    "plt.ylabel('Sales')\n",
    "plt.title('SARIMA Time Series Forecast')\n",
    "plt.legend()\n",
    "plt.show()\n"
